    var charger_fichier = function(url){
        $.ajaxSetup({
            async: false
        });
        var data;
        $.getJSON(url, function(d){
            data = d;
        });
        $.ajaxSetup({
            async: true
        });
        return data;
    }

    var afficher_geoJson = function(data){
        L.geoJson(data, {
            style: function (feature) {
                return {color: feature.properties.color};
            }
        }).addTo(window.plugin.iitcIncendies.levelLayerGroup);
    }

    var setup = function (){
        var colors = {"0":"grey","1":"green", "2":"yellow", "3":"orange", "4":"red"};
        var d = new Date();
        var url_fichier = "https://www.risque-prevention-incendie.fr/herault/import_data/" + d.getFullYear() + ("0" + (d.getMonth() + 1)).slice(-2) + ("0" + d.getDate()).slice(-2) + ".json";

        window.plugin.iitcIncendies.levelLayerGroup = new L.LayerGroup();
        window.addLayerGroup('Zones restrictions Incendies Herault', window.plugin.iitcIncendies.levelLayerGroup, true);

        var geojson = charger_geoJson();

        var features = geojson.features;

        var levels = charger_fichier(url_fichier);

            $.each(features,function(i,feature){
                var ID = feature.properties.ID;
                var level = levels.massifs[ID][0];
                var color = colors[level];
                feature.properties.level = level;
                feature.properties.color = color;
                features[i] = feature;
            });
            geojson.features = features;

        console.log(geojson);

        afficher_geoJson(geojson);

        $('#toolbox').append('<a onclick="window.plugin.iitcIncendies.manualOpt();return false;"">Légende restrictions incendies Herault</a>');
    }

